"use strict";
var num1 = 10;
var num2 = 2;
var res = 0;
res = num1 + num2;
console.log("加: " + res); // 输出: 12
res = num1 - num2;
console.log("减: " + res); // 输出: 8
res = num1 * num2;
console.log("乘: " + res); // 输出: 20
res = num1 / num2;
console.log("除: " + res); // 输出: 5
res = num1 % num2;
console.log("余数: " + res); // 输出: 0
num1++;
console.log("num1 自增运算: " + num1); // 输出: 11
num2--;
